import React from "react";
import WebSiteComment from "./WebSiteComment";

function WebSiteComments(props) {
  return (
    <React.Fragment>
      {props.comments.map((comment) => (
        <WebSiteComment commentData={comment} />
      ))}
    </React.Fragment>
  );
}

export default WebSiteComments;
